DiagnosticDescription:
Each class in a class library that is intended for dependency injection should have a corresponding service extension.
E.g.
public static class ServiceExtensions
{
   [Exposes(typeof(MyService)), As(typeof(IMyService))]
   public static IServiceCollection AddMyService(this IServiceCollection services)
   {
       return services.AddSingleton<IMyService, MyService>();
   }
}

If you get this warning in project that is not a class library, consider marking the method that initializes your service collection with the DependencyInjectionPoint attribute, e.g.
public class Startup
{
    [DependencyInjectionPoint]
    public void ConfigureServices(IServiceCollection services)
    {
         // adding all required services here
    }
}

A dependency is missing, which means it is unlikely that the program will function correctly. Add the dependency by using either the corresponding service extension, or by adding it with the AddScoped, AddSingleton, or AddTransient methods. If the dependency is added by an extension method that does not communicate which interfaces it exposes (e.g. third party libraries), add the Injects attribute to the DependencyInjectionPoint method. E.g. 
[DependencyInjectionPoint]
[Injects(typeof(ILogger<>))]
public void ConfigureServices(IServiceCollection services) 
{
    services.AddLogging(); // ...
}

Roslyn mapper definitions must follow strict structure.
Arguments can be passed by ordinal, by name or skipped. 
If they are present - they must be exactly inline defined lambdas or lambda arrays, nothing else.
  var mapper = new ExpressionMapper<Foo, Bar>(
                new ExpressionMappingComponents<Foo, Bar>(
                        (source) => new Bar() 
                        {
                            A = source.A
                        },
                        customMappings: (source) => new Bar()   // optional
                        {
                            B = 15
                        },
                        sourceIgnoredProperties:  new IgnoreList<Src>(  // optional
                            x => x.Ignore1
                        ),
                        targetIgnoredProperties: new IgnoreList<Trg>(   // optional
                            x => x.Ignore2
                        )));
